INSERT INTO `lng_data` VALUES ('pwassist','pwassist_session_expired','en','Please fill in this form again.\\nYour password assistance session has expired. This may have happened, because you tried to use the link that has been sent by e-mail to you more than once, or because too much time has passed since the link has been sent to you.',NULL);
INSERT INTO `lng_data` VALUES ('pwassist','pwassist_update_error','en','Please contact your system administrator.\\nThe password could not be assigned to the user account due to an error whe updating the data base.',NULL);
INSERT INTO `lng_data` VALUES ('pwassist','pwassist_username_mail_body','en','These are the active username found for the given e-mail address:\\n%s\\n\\nThis message has been created automatically by the following ILIAS Server:\\n\\t%s\\n\\nYou (or somebody with IP  %s) have requested support for forgotten usernames for the e-mail address \'%s\'.\\n\\nPlease check the following and act as suggested::\\n\\n-You have requested this e-mail by accident:\\nDelete this e-mail.\\n\\n-You are sure, that you never requested this e-mail:\\nPlease contact %s.\\n\\n- If you requested this e-mail, please proceed as follows::\\n\\n1. Start your internet browser.\\n\\n2. Enter the following url:\\n\\t%s\\n\\nImportant: The address is a single line. If you see this address split into multiple lines, then your e-mail program has inserted these line breaks.\\n\\n3. Your Browser now shows the Password-Service. Use this page together with one of the usernames and the according e-mail address to retrieve a new password.',NULL);
