a webfolder. Users can open webfolders using the \"open as webfolder\" action in the repository, or by entering the following address in a WebDAV client: <a href=\"%1$s\" folder=\"%1$s\">%1$s</a>\";s:18:\"webfolder_index_of\";s:13:\"Index of %1$s\";s:22:\"webfolder_instructions\";s:22:\"Webfolder instructions\";s:27:\"webfolder_instructions_info\";s:479:\"The webfolder instructions are shown on browsers, which can not open a webfolder directly. You can use HTML code, and the following placeholders: <b>[WEBFOLDER_TITLE]</b>, <b>[WEBFOLDER_URI]</b>, <b>[WEBFOLDER_URI_IE]</b>, <b>[WEBFOLDER_URI_KONQUEROR]</b>, <b>[WEBFOLDER_URI_NAUTILUS]</b>, <b>[ADMIN_MAIL]</b>, <b>[IF_WINDOWS]</b>...<b>[/IF_WINDOWS]</b>, <b>[IF_MAC]</b>...<b>[/IF_MAC]</b>, <b>[IF_LINUX]</b>...<b>[/IF_LINUX]</b>. Clear the field to get the default instructions.\";s:32:\"webfolder_instructions_titletext\";s:22:\"Open %1$s as webfolder\";s:27:\"webfolder_instructions_text\";s:2823:\"<p>Follow the instructions below, to open <b>[WEBFOLDER_TITLE]</b> as a webfolder:</p>[IF_WINDOWS]<h3>Instructions for Windows Vista</h3><ol><li>Press the key combination Windows+E to open Windows Explorer.</li><li>Click on \'Add Network Place\' in the toolbar. The \'Add a Network Place\' wizard will open.</li><li>Click at the link \'Connect to a website\'.</li><li>Select the \'Choose Another Network Location\' option, and select \'Next\'.<li>In the \'Internet or Network Address\' field enter<br/><b>[WEBFOLDER_URI]</b><br/>then select \'Next\'.</li><li>Enter your login and password, and select \'OK\'.</li>Repeat this step until you get to the next dialog window.</li><li>Enter a name for the webfolder, then select \'Next\'.<li>Enter your login and password, and select \'OK\'.</li>Repeat this step until you get to the next dialog window.</li><li>Select \'Finish\'.</li><li>You can now access the webfolder from the start menu \'Computer\'.</li></ol><h3>Instructions for Windows XP with Internet Explorer 6</h3><ol><li>Start Internet Explorer 6</li><li>Choose the menu \'File &gt; Open...\'</li><li>In the \'Open\' field enter the following address:<br/><b>[WEBFOLDER_URI_IE]</b></li><li>Select the \'Open as web-folder\' option, then select \'OK\'.</li><li>Enter your login and password, and select \'OK\'.</li></ol><h3>Instructions for Windows XP without Internet Explorer 6</h3><ol><li>Double-click the \'My Network Places\' icon on the Desktop.</li><li>Click on \'Add Network Place\' from the \'Network Tasks\' menu on the left side of the window.</li><li>The \'Add a Network Place\' wizard will open, select \'Next\'.</li><li>Select the \'Choose Another Network Location\' option, and select \'Next\'.<li>In the \'Internet or Network Address\' field enter<br/><b>[WEBFOLDER_URI]</b><br/>then select \'Next\'.</li><li>Enter your login and password, and select \'OK\'.</li></ol>[/IF_WINDOWS][IF_MAC]<h3>Instructions for Mac OS X</h3><ol><li>Open the Finder</li><li>Choose the menu \'Go &gt; Connect to server...\'</li><li>In the address field enter the following address:<br/><b>[WEBFOLDER_URI]</b>, and select \'Connect\'.</li><li>Enter your login and password, and select \'OK\'.</li></ol>[/IF_MAC][IF_LINUX]<h3>Instructions for Linux with Konqueror</h3><ol><li>Start the Konqueror browser</li><li>In the address field enter the following address:<br/><b>[WEBFOLDER_URI_KONQUEROR]</b></li><li>Press the Enter key.</li><li>Enter your login and password, and select \'OK\'.</li></ol><h3>Instructions for Linux with Nautilus</h3><ol><li>Start the Nautilus browser</li><li>In the address field enter the following address:<br/><b>[WEBFOLDER_URI_NAUTILUS]</b></li><li>Press the Enter key.</li><li>Enter your login and password, and select \'OK\'.</li></ol>[/IF_LINUX]<p>If opening the webfolder does not work, please contact <a href=\\\"mailto:[ADMIN_MAIL]\\\">[ADMIN_MAIL]</a>.</p>\";s:24:\"use_default_instructions\";s:25:\"Use default instructions.\";s:27:\"use_customized_instructions\";s:28:\"Use customized instructions:\";s:22:\"inline_file_extensions\";s:17:\"Web-enabled files\";s:27:\"inline_file_extensions_info\";s:158:\"Files with these extensions are displayed in the browser window.<br/>For example: <b>gif jpg mp3 pdf png</b><br/> All other files are offered for downloading.\";s:18:\"webfolder_dir_info\";s:122:\"You got here, because your browser can\'t open webfolders. Read the <a href=\"%1$s\">instructions for opening webfolders</a>.\";s:24:\"webfolder_mount_dir_with\";s:167:\"Open this page as a Webfolder with <a href=\"%1$s\">Internet Explorer 6</a>, <a href=\"%2$s\">Konqueror</a>, <a href=\"%3$s\">Nautilus</a>, <a href=\"%4$s\">other Browser</a>.\";s:20:\"deleted_user_account\";s:20:\"Deleted user account\";s:8:\"obj_cals\";s:8:\"Calendar\";s:28:\"webdav_pear_auth_http_needed\";s:127:\"You need to install Pear Auth_HTTP to use this function. To do this, enter <code>pear install Auth_HTTP</code> on the terminal.\";s:15:\"survey_defaults\";s:28:\"Default Settings for Surveys\";s:27:\"survey_unlimited_invitation\";s:20:\"Unlimited Invitation\";s:32:\"survey_unlimited_invitation_desc\";s:126:\"Allows unlimited invitation in surveys. Unlimited invitation adds the survey to the personal desktop of every registered user.\";s:22:\"display_webdav_actions\";s:22:\"Display WebDAV actions\";s:27:\"display_webdav_actions_info\";s:111:\"Displays the action \'open as webfolder\' next to each category, folder, course and group item in the repository.\";s:8:\"obj_sess\";s:7:\"Session\";s:9:\"objs_sess\";s:8:\"Sessions\";s:18:\"obj_sess_duplicate\";s:12:\"Copy Session\";s:15:\"obj_sess_select\";s:31:\"-- Please select one Session --\";s:4:\"sess\";s:7:\"Session\";s:8:\"attempts\";s:8:\"Attempts\";s:17:\"decrease_attempts\";s:12:\"Attempts - 1\";s:14:\"mem_reg_period\";s:19:\"Registration Period\";s:9:\"mem_start\";s:19:\"Registration Start:\";s:7:\"mem_end\";s:17:\"Registration End:\";s:16:\"mem_participants\";s:12:\"Participants\";s:13:\"mem_max_users\";s:17:\"Maximum of Users:\";s:15:\"mem_f