INSERT INTO `lng_modules` VALUES ('registration','en','a:57:{s:18:\"reg_add_assignment\";s:14:\"New Assignment\";s:20:\"reg_added_assignment\";s:21:\"Added new assignment.\";s:11:\"reg_approve\";s:29:\"Registration with Approvement\";s:16:\"reg_approve_info\";s:76:\"If checked any new user registration has to be approved by an administrator.\";s:19:\"reg_available_roles\";s:16:\"Available Roles:\";s:11:\"reg_default\";s:7:\"Default\";s:22:\"reg_deleted_assignment\";s:22:\"Deleted assignment(s).\";s:10:\"reg_direct\";s:19:\"Direct Registration\";s:15:\"reg_direct_info\";s:80:\"If this is checked, any new user registration request is automatically approved.\";s:12:\"reg_disabled\";s:24:\"No Registration Possible\";s:10:\"reg_domain\";s:6:\"Domain\";s:9:\"reg_email\";s:25:\"Automatic Role Assignment\";s:25:\"reg_email_role_assignment\";s:25:\"Role Assignment By Domain\";s:9:\"reg_fixed\";s:29:\"Selection From Specified List\";s:12:\"reg_info_pwd\";s:76:\"If enabled passwords will be send automatically to the new users per E-Mail.\";s:21:\"reg_mail_body_approve\";s:149:\"You already have registered to ILIAS eLearning and received a e-mail with your account data. Now your account has been activated by an administrator.\";s:21:\"reg_mail_body_profile\";s:13:\"Profile data:\";s:29:\"reg_mail_body_profile_changed\";s:26:\"your profile has changed !\";s:28:\"reg_mail_body_pwd_generation\";s:153:\"Your account request will be reviewed by an administrator, and should be activated within 48 hours. You will be informed about the approvement by e-mail.\";s:22:\"reg_mail_new_user_body\";s:31:\"A new user has been registered.\";s:18:\"reg_missing_domain\";s:27:\"Please fill out all fields.\";s:16:\"reg_missing_role\";s:27:\"Please fill out all fields.\";s:16:\"reg_notification\";s:13:\"Notifications\";s:21:\"reg_notification_info\";s:117:\"Enter one or more Login-Ids of users (comma seperated) that will be informed about new user registrations per e-mail.\";s:19:\"reg_role_assignment\";s:15:\"Role Assignment\";s:13:\"reg_role_info\";s:14:\"Assigned Roles\";s:14:\"reg_select_one\";s:24:\"Please select one entry.\";s:20:\"reg_selectable_roles\";s:16:\"Selectable Roles\";s:19:\"reg_settings_header\";s:25:\"New Registration Settings\";s:8:\"reg_type\";s:17:\"Registration Type\";s:22:\"reg_unknown_recipients\";s:35:\"The following logins are not valid:\";s:21:\"registration_settings\";s:17:\"New Registrations\";s:22:\"reg_access_limitations\";s:17:\"Access Limitation\";s:29:\"reg_enable_access_limitations\";s:24:\"Enable Access Limitation\";s:35:\"reg_access_limitation_limited_until\";s:23:\"Access is limited until\";s:34:\"reg_access_limitation_limited_time\";s:29:\"After registration access for\";s:26:\"reg_access_limitation_none\";s:16:\"Unlimited access\";s:34:\"reg_access_limitation_missing_mode\";s:53:\"Please choose for all roles an Access Limitation Mode\";s:33:\"reg_access_limitation_out_of_date\";s:53:\"One or more Roles have an outdated access limitation!\";s:27:\"reg_role_access_limitations\";s:59:\"Define access limitations of Roles for new registered Users\";s:26:\"reg_access_limitation_mode\";s:22:\"Access Limitation Mode\";s:36:\"reg_access_limitation_mode_unlimited\";s:20:\"No access limitation\";s:35:\"reg_access_limitation_mode_absolute\";s:33:\"Access is limited by a fixed date\";s:35:\"reg_access_limitation_mode_relative\";s:57:\"Limited access for a fixed time period after registration\";s:16:\"auth_radius_name\";s:28:\"Name of RADIUS Configuration\";s:21:\"auth_radius_name_desc\";s:50:\"Please choose a name for this server configuration\";s:16:\"auth_radius_sync\";s:20:\"User Synchronization\";s:23:\"auth_radius_role_select\";s:5:\"Role:\";s:21:\"auth_radius_sync_info\";s:91:\"If enabled new user accounts will be created automatically after successful authentication.\";s:21:\"reg_type_confirmation\";s:37:\"Registration with E-Mail Confirmation\";s:26:\"reg_type_confirmation_info\";s:186:\"This type allows self-registration of users but requires an email confirmation to activate the account. This avoids self-registration to ILIAS with wrong or non-existant email addresses.\";s:36:\"reg_confirmation_hash_life_time_info\";s:51:\"Enter the lifetime (seconds) of confirmation links.\";s:39:\"reg_confirmation_hash_life_time_expired\";s:43:\"The confirmation link is not valid anymore.\";s:31:\"reg_confirmation_hash_not_found\";s:59:\"No user account could be matched to this confirmation link.\";s:32:\"reg_confirmation_link_successful\";s:300:\"You successfully submitted an account request to ILIAS. You will receive a confirmation e-mail in the next minutes. Please confirm your registration by clicking the confirmation link in this mail.<br />You will be redirected to the <a href=\"%s\" title=\"login screen\">login screen</a> after 20 seconds.\";s:37:\"reg_activation_your_confirmation_link\";s:23:\"Your confirmation link:\";s:32:\"reg_confirmation_hash_not_passed\";s:46:\"The confirmation link was not entirely passed.\";}');
