INSERT INTO `lng_modules` VALUES ('news','en','a:80:{s:27:\"news_block_news_for_context\";s:4:\"News\";s:18:\"news_no_news_items\";s:18:\"No news available.\";s:22:\"news_block_information\";s:125:\"The <b>News</b> block lists all news that are related to the <b>Personal Items</b> you have selected on the personal desktop.\";s:15:\"news_rss_period\";s:10:\"RSS Period\";s:18:\"news_period_x_days\";s:12:\"Last %s Days\";s:18:\"news_period_1_week\";s:9:\"Last Week\";s:19:\"news_period_x_weeks\";s:13:\"Last %s Weeks\";s:19:\"news_period_1_month\";s:10:\"Last Month\";s:20:\"news_period_x_months\";s:14:\"Last %s Months\";s:18:\"news_period_1_year\";s:9:\"Last Year\";s:26:\"news_allow_shorter_periods\";s:21:\"Allow Shorter Periods\";s:25:\"news_allow_longer_periods\";s:20:\"Allow Longer Periods\";s:31:\"news_allow_shorter_periods_info\";s:58:\"Users may select shorter news periods on personal desktop.\";s:30:\"news_allow_longer_periods_info\";s:57:\"Users may select longer news periods on personal desktop.\";s:20:\"news_x_files_created\";s:25:\"%s Files have been added.\";s:20:\"news_x_files_updated\";s:27:\"%s Files have been updated.\";s:19:\"news_1_file_created\";s:22:\"1 File has been added.\";s:19:\"news_1_file_updated\";s:24:\"1 File has been updated.\";s:15:\"news_x_postings\";s:28:\"%s Postings have been added.\";s:15:\"news_1_postings\";s:25:\"1 Posting has been added.\";s:14:\"news_pd_period\";s:28:\"Personal Desktop News Period\";s:19:\"news_pd_period_info\";s:127:\"Defines the time period used for news on the personal desktop. Select lower values, if you experience any performance problems.\";s:15:\"news_indefinite\";s:10:\"Indefinite\";s:17:\"news_loading_news\";s:15:\"Loading News...\";s:21:\"news_no_js_click_here\";s:38:\"If news are not displayed, click here.\";s:14:\"news_acc_cache\";s:26:\"Permission Check (Minutes)\";s:19:\"news_acc_cache_info\";s:175:\"Check read permissions for news items all x minutes (personal desktop only). \'0\' means everytime. Higher values improve performance, but news may link to non-accessible items.\";s:16:\"news_nr_of_items\";s:39:\"Number of Maximum News Items per Object\";s:21:\"news_nr_of_items_info\";s:227:\"Number of news items that are kept for an object (e.g. a file or a learning module) in the database. Please note, that container objects (e.g. categories, courses) may list more items, because they aggregate news of subobjects.\";s:15:\"news_related_to\";s:10:\"Related To\";s:14:\"news_all_items\";s:9:\"All Items\";s:23:\"news_edit_news_settings\";s:13:\"Edit Settings\";s:25:\"news_enable_internal_news\";s:20:\"Enable Internal News\";s:30:\"news_enable_internal_news_info\";s:148:\"Activates news blocks for categories, courses, groups and other objects. Users can subscribe to news and news are presented on the personal desktop.\";s:24:\"news_enable_internal_rss\";s:28:\"Enable RSS for Internal News\";s:29:\"news_enable_internal_rss_info\";s:114:\"Allows to publish news items via RSS. These items will be accessible outside of the system without authentication.\";s:38:\"news_first_letter_of_word_notification\";s:1:\"N\";s:18:\"news_notifications\";s:13:\"Notifications\";s:19:\"news_news_item_head\";s:9:\"News Item\";s:20:\"news_hide_news_block\";s:15:\"Hide News Block\";s:25:\"news_hide_news_block_info\";s:98:\"Hide block in learner\'s view. The news block will only be visible for users with write permission.\";s:22:\"news_hidden_news_block\";s:44:\"Block is currently hidden in learner\'s view.\";s:23:\"news_hide_news_per_date\";s:15:\"Show News After\";s:28:\"news_hide_news_per_date_info\";s:63:\"Only news that are newer than a certain date will be displayed.\";s:19:\"news_hide_news_date\";s:13:\"Starting Date\";s:23:\"news_default_visibility\";s:14:\"Default Access\";s:20:\"news_news_item_title\";s:8:\"Headline\";s:22:\"news_news_item_content\";s:4:\"Text\";s:27:\"news_news_item_content_long\";s:9:\"Long Text\";s:32:\"news_news_item_content_long_info\";s:40:\"This text will not be published via RSS.\";s:21:\"news_visibility_users\";s:15:\"Logged in Users\";s:22:\"news_visibility_public\";s:6:\"Public\";s:23:\"news_get_priv_feed_info\";s:307:\"This is a personal private news feed URL. The feed includes news that are declared as public and private by the author. This feed is protected by a password, which can be changed under \"Settings\". Please do not share this URL with other people. Please replace -password- in this URL with your Feed-Password.\";s:24:\"news_get_priv_feed_title\";s:25:\"Personal private Feed-URL\";s:24:\"news_enable_private_feed\";s:23:\"Enable private Newsfeed\";s:29:\"news_enable_private_feed_info\";s:148:\"If this option is enabled, public and private news can be obtained by personal RSS feeds outside of ILIAS. Authentification is provided by password.\";s:22:\"passwd_equals_ilpasswd\";s:59:\"Please enter a password different from your ILIAS-password.\";s:18:\"priv_feed_disabled\";s:26:\"Private Newsfeed disabled.\";s:18:\"priv_feed_settings\";s:25:\"Private Newsfeed settings\";s:25:\"priv_feed_no_access_title\";s:28:\"Private Newsfeed is disabled\";s:24:\"priv_feed_no_access_body\";s:64:\"Please contact the system administrator for further information.\";s:23:\"priv_feed_no_auth_title\";s:23:\"Authentification failed\";s:22:\"priv_feed_no_auth_body\";s:86:\"Please make sure you enabled your private Newsfeed and entered the password correctly.\";s:25:\"news_news_item_visibility\";s:6:\"Access\";s:15:\"news_news_items\";s:12:\"News Item(s)\";s:14:\"news_subscribe\";s:9:\"Subscribe\";s:16:\"news_unsubscribe\";s:11:\"Unsubscribe\";s:18:\"news_internal_news\";s:4:\"News\";s:17:\"news_get_feed_url\";s:12:\"Get Feed URL\";s:17:\"news_feed_url_for\";s:17:\"Feed URL for \'%s\'\";s:19:\"news_get_feed_title\";s:17:\"Personal Feed URL\";s:18:\"news_get_feed_info\";s:211:\"This is a personal news feed URL. The feed includes only news that are declared as public by the author. The feed is not protected by any authentication procedure. Please do not share this URL with other people.\";s:13:\"news_feed_url\";s:8:\"Feed URL\";s:13:\"news_settings\";s:13:\"News Settings\";s:25:\"news_notifications_public\";s:20:\"Public Notifications\";s:30:\"news_notifications_public_info\";s:175:\"If this option is enabled, notifications can be obtained by personal RSS feeds outside of ILIAS. Please note that this makes notifications accessible without authentification.\";s:16:\"news_public_feed\";s:14:\"Extra RSS Feed\";s:21:\"news_public_feed_info\";s:78:\"If this option is enabled, a separate RSS feed is provided for this Mediacast.\";s:30:\"news_news_item_visibility_info\";s:128:\"Public news can be accessed without authentication outside of ILIAS via RSS. Please do not include any confidential information.\";s:16:\"news_time_period\";s:11:\"Time Period\";}');
INSERT INTO `lng_modules` VALUES ('feed','en','a:18:{s:15:\"feed_feed_items\";s:12:\"Feed Item(s)\";s:10:\"feed_proxy\";s:10:\"Proxy Host\";s:15:\"feed_proxy_info\";s:32:\"Proxy host for socket connection\";s:15:\"feed_proxy_port\";s:10:\"Proxy Port\";s:20:\"feed_proxy_port_info\";s:32:\"Proxy port for socket connection\";s:17:\"feed_loading_feed\";s:15:\"Loading Feed...\";s:21:\"feed_no_js_click_here\";s:37:\"If feed is not displayed, click here.\";s:22:\"feed_disable_rep_feeds\";s:40:\"Disable External Web Feeds in Categories\";s:27:\"feed_disable_rep_feeds_info\";s:127:\"This option deactivates all existing external web feed blocks, in case of an unexpected problem due to an external feed source.\";s:16:\"feed_nr_pd_feeds\";s:44:\"Number of External Feeds on Personal Desktop\";s:21:\"feed_nr_pd_feeds_info\";s:196:\"Sets the maximum number of external web feeds, that users may add to their personal desktop. Existing feeds are not deleted, if option is set to a lower value. \'0\' disables the feature completely.\";s:13:\"feed_settings\";s:27:\"External Web Feeds Settings\";s:21:\"feed_open_source_page\";s:18:\"Open in New Window\";s:21:\"block_feed_block_head\";s:17:\"External Web Feed\";s:22:\"block_feed_block_title\";s:5:\"Title\";s:25:\"block_feed_block_feed_url\";s:8:\"Feed URL\";s:17:\"feed_no_valid_url\";s:26:\"The Feed URL is not valid.\";s:30:\"block_feed_block_feed_url_info\";s:68:\"Must be a valid RSS/Atom URL, e.g. http://www.ilias.de/iosbb/rss.php\";}');
INSERT INTO `lng_modules` VALUES ('pdesk','en','a:8:{s:16:\"bm_num_bookmarks\";s:11:\"Bookmark(s)\";s:23:\"bm_num_bookmark_folders\";s:9:\"Folder(s)\";s:11:\"pdesk_intro\";s:33:\"Welcome to your Personal Desktop!\";s:12:\"pdesk_intro2\";s:160:\"This is your personal space for organising your working and learning. You can put resources from other areas on your personal desktop. Doing so takes two steps:\";s:12:\"pdesk_intro3\";s:69:\"Click on \'%s\' and browse the existing working and learning resources.\";s:12:\"pdesk_intro4\";s:104:\"If you found something of interest, add it to your desktop by clicking the <i>Add to Desktop</i> button.\";s:22:\"pdesk_feedback_request\";s:16:\"Feedback Request\";s:15:\"pdesk_feedbacks\";s:19:\"Feedback Request(s)\";}');
INSERT INTO `lng_modules` VALUES ('rep','en','a:7:{s:9:\"rep_intro\";s:26:\"Welcome to the Repository!\";s:10:\"rep_intro1\";s:247:\"In this area you can create learning and working resources for all users. All resources are organised in categories. Categories can reflect the structure of your organisation (e.g. departments), a hierarchie of disciplines, or classes of a school.\";s:10:\"rep_intro2\";s:53:\"Three steps are needed to build an initial structure:\";s:10:\"rep_intro3\";s:74:\"Click on the <i>%s</i> button besides the selection list on the top right.\";s:10:\"rep_intro4\";s:79:\"In the following form, enter a title and a description, and click on <i>%s</i>.\";s:10:\"rep_intro5\";s:65:\"By clicking on the title of the category you enter your category.\";s:10:\"rep_intro6\";s:83:\"After that procedure you may add any learning or working resource to your category.\";}');
